import React from 'react';

import './Avatar.css';

const Avatar = propss => {
  return (
    <div className={`avatar ${propss.className}`} style={propss.style}>
      <img
        src={propss.image}
        alt={propss.alt}
        style={{ width: propss.width, height: propss.width }}
      />
    </div>
  );
};

export default Avatar;
